import './App.css';

function App() {
  const api_ex = () => {
    fetch('https://api.npms.io/v2/search?q=react')
        .then(response => response.json())
        .then(data => this.setState({ totalReactPackages: data.total }));
  }


  return (
    <div className="App">
      <header>Hi!</header>
    </div>
  );
}

export default App;
